                  <div className="col-lg-7">
                    <div className="infodiv">
                      <div className="row">
                        <div className="col-lg-3">Id</div>
                        <div className="col-lg-9">{
                            bugInfo[a][1]["Id"]
                              ? bugInfo[a][1]["Id"]
                              : "None"
                          }</div>
                      </div>
